var codeAdvance = "\n<template>\n  <div id=\"my-container\">\n    <div class=\"my-1\">\n      <!-- Our triggering (target) element -->\n      <b-button\n        id=\"popover-reactive-1\"\n        ref=\"button\"\n        v-ripple.400=\"'rgba(255, 255, 255, 0.15)'\"\n        variant=\"primary\"\n      >\n        Reactive Content Using Slots\n      </b-button>\n    </div>\n\n    <!-- Output from the popover interaction -->\n    <b-card\n      v-if=\"input1Return && input2Return\"\n      title=\"Returned values:\"\n      class=\"shadow-none border mb-0\"\n    >\n      <p\n        class=\"card-text\"\n        style=\"max-width: 20rem;\"\n      >\n        Name: <strong>{{ input1Return }}</strong><br>\n        Color: <strong>{{ input2Return }}</strong>\n      </p>\n    </b-card>\n\n    <!-- Our popover title and content render container -->\n    <!-- We use placement 'auto' so popover fits in the best spot on viewport -->\n    <!-- We specify the same container as the trigger button, so that popover is close to button -->\n    <b-popover\n      ref=\"popover\"\n      target=\"popover-reactive-1\"\n      triggers=\"click\"\n      :show.sync=\"popoverShow\"\n      placement=\"auto\"\n      container=\"my-container\"\n      @show=\"onShow\"\n      @shown=\"onShown\"\n      @hidden=\"onHidden\"\n    >\n      <template v-slot:title>\n        <div class=\"d-flex justify-content-between align-items-center\">\n          <span>Interactive Content</span>\n          <b-button\n            v-ripple.400=\"'rgba(255, 255, 255, 0.15)'\"\n            class=\"close\"\n            variant=\"transparent\"\n            aria-label=\"Close\"\n            @click=\"onClose\"\n          >\n            <span\n              class=\"d-inline-block text-white\"\n              aria-hidden=\"true\"\n            >&times;</span>\n          </b-button>\n        </div>\n      </template>\n\n      <div>\n        <b-form-group\n          label=\"Name\"\n          label-for=\"popover-input-1\"\n          label-cols=\"3\"\n          :state=\"input1state\"\n          class=\"mb-1\"\n          description=\"Enter your name\"\n          invalid-feedback=\"This field is required\"\n        >\n          <b-form-input\n            id=\"popover-input-1\"\n            ref=\"input1\"\n            v-model=\"input1\"\n            :state=\"input1state\"\n            size=\"sm\"\n          />\n        </b-form-group>\n\n        <b-form-group\n          label=\"Color\"\n          label-for=\"popover-input-2\"\n          label-cols=\"3\"\n          :state=\"input2state\"\n          class=\"mb-1\"\n          description=\"Pick a color\"\n          invalid-feedback=\"This field is required\"\n        >\n          <b-form-select\n            id=\"popover-input-2\"\n            v-model=\"input2\"\n            :state=\"input2state\"\n            :options=\"options\"\n            size=\"sm\"\n          />\n        </b-form-group>\n\n        <b-alert\n          show\n          class=\"small mb-1\"\n        >\n          <div class=\"alert-body\">\n            <strong>Current Values:</strong><br>\n            Name: <strong>{{ input1 }}</strong><br>\n            Color: <strong>{{ input2 }}</strong>\n          </div>\n        </b-alert>\n\n        <b-button\n          v-ripple.400=\"'rgba(255, 255, 255, 0.15)'\"\n          size=\"sm\"\n          variant=\"danger\"\n          class=\"mr-1\"\n          @click=\"onClose\"\n        >\n          Cancel\n        </b-button>\n        <b-button\n          v-ripple.400=\"'rgba(255, 255, 255, 0.15)'\"\n          size=\"sm\"\n          variant=\"primary\"\n          @click=\"onOk\"\n        >\n          Ok\n        </b-button>\n      </div>\n    </b-popover>\n  </div>\n</template>\n\n<script>\nimport {\n  BPopover, BButton, BAlert, BFormGroup, BFormSelect, BFormInput, BCard,\n} from 'bootstrap-vue'\nimport Ripple from 'vue-ripple-directive'\n\nexport default {\n  components: {\n    BPopover,\n    BButton,\n    BAlert,\n    BFormGroup,\n    BFormSelect,\n    BFormInput,\n    BCard,\n  },\n  directives: {\n    Ripple,\n  },\n  data: () => ({\n    input1: '',\n    input1state: null,\n    input2: '',\n    input2state: null,\n    options: [{ text: '- Choose 1 -', value: '' }, 'Red', 'Green', 'Blue'],\n    input1Return: '',\n    input2Return: '',\n    popoverShow: false,\n  }),\n  watch: {\n    input1(val) {\n      if (val) {\n        this.input1state = true\n      }\n    },\n    input2(val) {\n      if (val) {\n        this.input2state = true\n      }\n    },\n  },\n  methods: {\n    onClose() {\n      this.popoverShow = false\n    },\n    onOk() {\n      if (!this.input1) {\n        this.input1state = false\n      }\n      if (!this.input2) {\n        this.input2state = false\n      }\n      if (this.input1 && this.input2) {\n        this.onClose()\n        // Return our popover form results\n        this.input1Return = this.input1\n        this.input2Return = this.input2\n      }\n    },\n    onShow() {\n      // This is called just before the popover is shown\n      // Reset our popover form variables\n      this.input1 = ''\n      this.input2 = ''\n      this.input1state = null\n      this.input2state = null\n      this.input1Return = ''\n      this.input2Return = ''\n    },\n    onShown() {\n      // Called just after the popover has been shown\n      // Transfer focus to the first input\n      this.focusRef(this.$refs.input1)\n    },\n    onHidden() {\n      // Called just after the popover has finished hiding\n      // Bring focus back to the button\n      this.focusRef(this.$refs.button)\n    },\n    focusRef(ref) {\n      // Some references may be a component, functional component, or plain element\n      // This handles that check before focusing, assuming a `focus()` method exists\n      // We do this in a double `$nextTick()` to ensure components have\n      // updated & popover positioned first\n      this.$nextTick(() => {\n        this.$nextTick(() => {\n          (ref.$el || ref).focus()\n        })\n      })\n    },\n  },\n}\n</script>\n";

